import React from 'react'
// import "./Page16.css"
import { Avatar } from 'antd';
import {  DownOutlined } from '@ant-design/icons';
import { Row, Col, Slider } from 'antd';



const style = { background: '#0092ff', padding: '12px' ,width:'45%'};
function Page16() {
    return (
        <div className="App">
        <Layout>
          < Sider className="box1">
          
                      <ul>
                          <li><a href={"/Page16"}>แดชบอร์ด</a></li>
                          <li><a href={"/Page3"}>การประเมินผลสัมฤทธิ์</a></li>
                          <li><a href={"/Page51"}>จัดการผู้ใช้</a></li>
                          {/* <li><a href="#about">About</a></li> */}
                      </ul>
                      
            </Sider>
       
          <Layout>
            
          <Header style={{ padding: 10 }}>
            <Avatar style={{ float: 'right' }} src='./dp.png' />
            <Title style={{ color: 'white' }} level={3}>SHRIDEEP</Title>
          </Header>
          <Content style={{ padding: '0 50px' }}>
              
              </Content>
            
            
          </Layout>
        </Layout>
      </div>



    )
}

export default Page16
